function Movies({ movies }) {
  return (
    <ul>
      {movies?.map((movie) => (
        <li key={movie.imdbID}>
          <img src={movie.Poster} alt={movie.Title}></img>
          <h2>Title: {movie.Title}</h2>
          <p>Release Date: {movie.Year}</p>
        </li>
      ))}
    </ul>
  )
}

export default Movies
